import React from 'react';
import styled from 'styled-components';

const Work = () => (
    <WorkContainer>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
    </WorkContainer>

)

const WorkContainer = styled.div`
    display: grid;
    grid-template-columns: 1fr;
    grid-gap: 1em;
    height: 100%;
    min-height: 100vh;
    padding: 100px 2em;
    max-width: 600px;
    width: 100%;
    margin: 0 auto;
`;

export default Work;
